create or replace function setchannelslocalfiles(
    _data jsonb,
    _params jsonb,
    _operator jsonb
) returns jsonb
    language plpgsql
as
$$
DECLARE
    permission jsonb;
    _channelid numeric;
    _tenantid  text;
    _j jsonb;
    aux numeric;
    R record;
    _result jsonb = '[]';
BEGIN
    _channelid := jgkn(_params,'channelid');
    update channelvideos set status = 'check' where channelid = _channelid;
    for _j in select jsonb_array_elements(_data) loop

        select count(*) into aux from videos where filename = trim((_j->>'name')::text);
        raise notice 'GET [%] %',aux, _j->>'name';
        if (aux > 0) then
            select * into R from videos where filename = (_j->>'name')::text;
            raise notice 'GET % for % | %',R.id,R.filename, _j->>'name';
            select count(*) into aux from channelvideos where channelid = _channelid and id = R.id;
            if (aux = 0) then
                insert into channelvideos (channelid, id, status)
                values (_channelid,R.id,'enabled');
            end if;
            update videos set status ='present' where filename = trim((_j->>'name')::text);
        end if;
    end loop;
    delete from videos where id in (select id from channelvideos where status = 'check' and channelid = _channelid);
    if (_result is null) then
        _result = '[]';
    end if;
    return _result;
END;
$$;

